pragma solidity ^0.8.7;
/*
* TODOs:
* 1. Set up validator sign-ups
* 2. Set up signature validation
* 3. 
*/
contract EthCA {
    mapping (address => bool) signedup;
    mapping (uint => validationRequest) requests;
    uint numsignups;
    uint numRequests;
    struct validationRequest {
        uint id;
        uint nonce;
        mapping (address => bool) validators;
        string domain;

    }
    //Should be the primary call from domain owners wanting a certificate; returns RSA-encrypted nonce produced from the sender's public key
    //
    function request_verification() public returns (uint) {
        uint nonce = uint(sha256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender, numsignups)));
        requests[numRequests].nonce = nonce;
        requests[numRequests].id = numRequests;

     }
}

